export class LedgerDetail {
    amount: string
    currency: string
    isCredit: boolean
    description: string
    createdAt: string

    constructor(amount: string, currency: string, isCredit: boolean, description: string, createdAt: string) {
        this.amount = amount;
        this.currency = currency;
        this.isCredit = isCredit;
        this.description = description;
        this.createdAt = createdAt;
    }

    get symbol(): string {
        if (this.currency == "JPY") { return "¥"; }
        else if (this.currency == "USD") {return "$"; }
        else if (this.currency == "KRW") {return "₩"; }
        else {
            return "$";
        }
    }

    get isRefund(): string {
        if (this.isCredit) { return "-"; }
        else { return  ""; }
    }
}
